import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Header from "./Header"; // ✅ 우리가 쓰는 헤더
import ValueIntro1 from "./assets/valueIntro1.png";
import ValueIntro2 from "./assets/valueIntro2.png";
import ValueIntro3 from "./assets/valueIntro3.png";// ✅ 이미지 import (경로 확인 필요)

function ValueIntro(setMenuOpen) {
  const navigate = useNavigate();
  const [step, setStep] = useState(0);


  const pages = [
    {
      image: ValueIntro1,
      content: (
        <>
          <div style={bubbleStyle}>
            <p><strong style={{ color: "#1292EE" }}>‘가치’란?</strong><br />
            우리가 세상, 타인, 그리고 자기 자신과<br />
            어떻게 관계 맺기를 원하는지를 향한<br />
            마음 깊은 바람입니다.</p>
          </div>
          <div style={connector}></div>
          <div style={bubbleStyleSecondary}>
            <p>
              가치는 우리 삶을 이끄는 <strong>원칙</strong>이자,<br />
              삶을 살아가는 데 동기를 부여해주는 <strong>방향성</strong>입니다.
            </p>
          </div>
        </>
      ),
      layout: "centered"
    },
    {
      image: ValueIntro2,
      content: (
        <p style={{ color: "#1292EE", fontWeight: "bold", fontSize: "1rem", textAlign: "center", lineHeight: "1.6" }}>
          모든 사람이 똑같은 가치를 갖지 않아요.<br />
          밸류는 당신의 가치를 판단하지도 않아요.
        </p>
      ),
      layout: "top-center"
    },
    {
      image: ValueIntro3,
      content: (
        <p style={{ color: "#1292EE", fontWeight: "bold", fontSize: "1rem", textAlign: "center", lineHeight: "1.6" }}>
          당신의 워크시트는 외부로 공개되지 않아요.<br />
          지금 당신의 가치를 찾아보세요.
        </p>
      ),
      layout: "top-center"
    }
  ];

  const current = pages[step];

  const handleNext = () => {
    if (step < pages.length - 1) {
      setStep(step + 1);
    } else {
      navigate("/survey");
    }
  };

  return (
    <div style={{ backgroundColor: "#f5fafe", minHeight: "100vh", fontFamily: "sans-serif" }}>
      <Header title="내 삶의 방향 찾기" setMenuOpen={setMenuOpen}/>
      <div style={{ padding: "1.2rem", maxWidth: "500px", margin: "0 auto" }}>
        <div style={{ marginBottom: "1.5rem" }}>
          <img src={current.image} alt="인트로" style={{ width: "100%", borderRadius: "12px" }} />
        </div>
        <div style={{ textAlign: "center", fontSize: "0.95rem", color: "#333" }}>
          {current.subtitle}
        </div>
      </div>

      <div style={{ maxWidth: "500px", margin: "2rem auto", padding: "0 1.2rem" }}>
        <button
          onClick={handleNext}
          style={{
            width: "100%",
            padding: "1rem 0",
            fontSize: "1.1rem",
            backgroundColor: "#1292EE",
            color: "white",
            border: "none",
            borderRadius: "12px",
            fontWeight: "bold"
          }}
        >
          다음으로
        </button>
      </div>
    </div>
  );
}

// 💬 스타일
const imageContainer = {
  position: "relative",
  width: "100%",
  height: "auto",
  marginBottom: "2rem"
};

const imageStyle = {
  width: "100%",
  borderRadius: "12px"
};

const overlayBox = {
  position: "absolute",
  top: "10%",
  left: "50%",
  transform: "translateX(-50%)",
  width: "85%",
  zIndex: 2
};

const bubbleStyle = {
  backgroundColor: "#fff",
  border: "1px solid #1292EE",
  borderRadius: "20px",
  padding: "1rem",
  fontSize: "0.95rem",
  color: "#333",
  lineHeight: "1.5",
  marginBottom: "0.8rem"
};

const bubbleStyleSecondary = {
  backgroundColor: "#d9efff",
  borderRadius: "16px",
  padding: "1rem",
  fontSize: "0.95rem",
  color: "#333",
  lineHeight: "1.5"
};

const connector = {
  height: "16px",
  width: "2px",
  backgroundColor: "#1292EE",
  margin: "0.5rem auto"
};


export default ValueIntro;
